import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import './Aboutme.css'; // Import the CSS file

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'üåç Renuem',
      description: (
        <ul>
          <li>Developed a renewable energy investment app using React Native and Node.js.</li>
          <li>Deployed backend on AWS, integrating MySQL RDS for real-time tracking.</li>
          <li>Collaborated with stakeholders to align the app with business goals.</li>
        </ul>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: 'üíº Clear Ear',
      description: (
        <ul>
          <li>Designed an Android app using React Native for hearing clinic operations.</li>
          <li>Integrated AsyncStorage for managing patient details and appointment history.</li>
        </ul>
      ),
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'üéÆ Mo‚Äôs Pvt',
      description: (
        <ul>
          <li>Conducted data analysis for product launches and market trends.</li>
          <li>Developed the Mo‚Äôs Games website to enhance online presence.</li>
        </ul>
      ),
    },
  ];

  return (
    <div className="main">
      <div className="heroSection">
        <img src={untitled} alt="Mohammed" className="image" />
        <div className="paragraph">
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst, I‚Äôve built my career
            around designing efficient, user-focused solutions that bridge technical innovation with real-world impact.
          </p>
          <p>
            If you‚Äôre interested in learning more about my projects or discussing collaboration opportunities, feel free to explore further.
          </p>
        </div>
      </div>

      <h3 className="sectionHeader">Tech Languages</h3>
      <div className="logoContainer">
        {techLanguages.map(({ id, src, name }) => (
          <div
            key={id}
            className="logoWrapper"
            onMouseEnter={() => setTooltipVisible({ ...tooltipVisible, [id]: true })}
            onMouseLeave={() => setTooltipVisible({ ...tooltipVisible, [id]: false })}
          >
            <img id={id} src={src} alt={name} className="logo" />
            {tooltipVisible[id] && <div className="tooltip">{name}</div>}
          </div>
        ))}
      </div>

      <h3 className="sectionHeader">Work History</h3>
      <Timeline position={isMobileView ? 'right' : 'alternate'}>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent
              sx={{ m: 'auto 0' }}
              align="right"
              variant="body2"
              color="#808080"
            >
              {id}
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
              <img src={icon} alt={title} className="timelineIcon" />
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent sx={{ py: '12px', px: 2 }}>
              <Typography variant="h6" component="span">{title}</Typography>
              <Typography>{description}</Typography>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
